import {createBrowserRouter, RouterProvider} from "react-router-dom";
import LoginSupervisor from './routes/supervisor/LoginSupervisor'
import SearchProblem from './routes/supervisor/SearchProblem'
import Problem from './routes/supervisor/Problem'

export const router = createBrowserRouter([
  {
    path: "/",
    element: <SearchProblem/>,
  },
  {
    path: "login_supervisor",
    element: <LoginSupervisor/>
  },
  {
    path: "Problem",
    element: <Problem/>
  }
]);
